    "Text recognition for your images" : "Reconhecimento de texto para suas imagens",
    "# Description\n\nNextcloud OCR (optical character recognition) processing for images with tesseract-js brings OCR capability to your Nextcloud.\nThe app uses tesseract-js in the browser in order to process images (png, jpeg, tiff, bmp) and saves the output PDF file to the source folder in nextcloud. That for example enables you to search in it.\n\n## Prerequisites, Requirements and Dependencies\nThe OCR app has some prerequisites:\n\n - [Nextcloud 16 and up](https://nextcloud.com/)\n\n - Only supported on latest modern web browsers (Chrome, Edge, Firefox, Opera, Safari*)\n\n - Tesseract traineddata needs about 200 MB space on your server (will be installed automatically).\n\n\n_* On Safari there is currently a problem with the [Content-Security-Policy](https://developer.mozilla.org/en-US/docs/Web/HTTP/CSP), that requires an Administrator to set the 'script-src' to 'unsafe-eval' such that the app works properly. Because this is quite insecure the app itself does not set it and recommends to decide that on your own risk (please make sure, that you know what CSP is and what e.g. unsafe-eval causes)._\n\n## Installation\nInstall the app from the [Nextcloud AppStore](https://apps.nextcloud.com/apps/ocr) or download the release package from github (**NOT** the sources) and place the content in **nextcloud/apps/ocr/**.\n\n## Disclaimer\nThe software is distributed on an \"AS IS\" BASIS, WITHOUT WARRANTIES OR\nCONDITIONS OF ANY KIND, either express or implied.\n\n## Note\nThe version 3 and earlier versions are not supported/maintained anymore by the author. So for asynchronous background processing please fork the repository and use the \"not-maintained\" branch to work on improvements. The author wasn't able to support it because of too much effort.\nMoreover this project is based on a webassembly port of tesseract. The maintainer stopped working on PDF processing in this app and will start working on separate app for pdf handling." : "# Descrição\n\nO processamento Nextcloud OCR (reconhecimento óptico de caracteres) para imagens com o tesseract-js traz o recurso OCR ao seu Nextcloud.\nO aplicativo usa o tesseract-js no navegador para processar imagens (png, jpeg, tiff, bmp) e salva o arquivo de saída PDF na pasta de origem no Nextcloud. Isso permite pesquisar nele.\n\n## Pré-requisitos, Requisitos e Dependências\nO aplicativo OCR possui alguns pré-requisitos:\n\n - [Nextcloud 16 e acima](https://nextcloud.com/)\n\n - Suportado apenas nos navegadores mais novos (Chrome, Edge, Firefox, Opera, Safari*)\n\n - Os dados treinados do Tesseract precisam de aproximadamente 200 MB de espaço no servidor (serão instalados automaticamente).\n\n\n_* No Safari, atualmente há um problema com o [Content-Security-Policy](https://developer.mozilla.org/en-US/docs/Web/HTTP/CSP), isso requer que um administrador defina 'script-src' como 'unsafe-eval' para que o aplicativo funcione corretamente. Como isso é bastante inseguro, o aplicativo não o configura por si e recomenda que você decida por seu próprio risco (verifique o que é CSP e quais são as causas de unsafe-eval)._\n\n## Instalação\nInstale o aplicativo na [Nextcloud AppStore](http://apps.nextcloud.com) ou baixe o pacote de lançamento no github (**NÃO** os fontes) e coloque o conteúdo em **nextcloud/apps/ocr/**.\n\n## Aviso Legal\nO software é distribuído na base de \"COMO ESTÁ\", SEM GARANTIAS OU\nCONDIÇÕES DE QUALQUER TIPO, explícito ou implícito.\n\n## Considerações\nA versão 3 e anteriores não são mais suportadas/mantidas pelo autor. Portanto, para processamento em segundo plano assíncrono, bifurque o repositório e use a ramificação \"não mantida\" para trabalhar em melhorias. O autor não conseguiu apoiá-lo devido a muito trabalho.\nAlém disso, este projeto é baseado em uma montagem da Web do tesseract. O mantenedor parou de trabalhar no processamento de PDF neste aplicativo e começará a trabalhar em um aplicativo separado para manipulação de pdf.",
